import React from 'react';
import logo from './logo.svg';
import './css/App.css';
import Letter from './containers/letter';


function App() {
  const word = "wonder";



  return (
    <div className="App">
      <Letter className="firstLetter" word={word} position={1} />
      <Letter word={word} position={2} />
      <Letter word={word} position={3} />
      <Letter word={word} position={4} />
      <Letter word={word} position={5} />
      <Letter word={word} position={6} />
    </div>
  );
}

export default App;
